import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Users from '../Pages/Users/UsersCRUD.jsx';
import Navigation from './Navigation/Navigation.jsx'; // Importa Navigation.jsx



function HomeNavigation() {
  return (
    <div>
      <Navigation /> {/* Renderiza Navigation.jsx */}

    </div>
  );
}

function Root() {
  return (
    <Router>
      <Route exact path="/" component={HomeNavigation} /> {/* Usa HomeNavigation como componente para la ruta "/" */}
      <Route path="/usuarios" component={Users} />
      {/*<Route path="/peliculas" component={Peliculas} />
      <Route path="/rentas" component={Rentas} />*/}
    </Router>
  );
}

export default Root;
